655 Provide grb::set( matrix, mask, value ) (#246)

This MR formalises the `grb::set(matrix,matrix)` and `grb::set(matrix,mask,scalar)` variants. For the former, all backends did implement it and an exhaustive unit test existed prior to this MR, but a specification of the function was missing-- this MR adds this. For the latter, all backends did implement one variant of it which was tested in the unit test for the matrix-matrix `grb::set`. This MR specifies and implements all possible variants of `grb::set(matrix,mask,scalar)`, and adds a unit test that exhaustively tests all combinations under which `grb::set(matrix,mask,scalar)` may be called.

To realise this MR, the following features were introduced:

- the ALP utilities now include a prefix-sum algorithm, both sequential and in OpenMP. The implementation of some of the new functionalities depend on this operation. Existing prefix-sum computations should rely on this new utility function; GitHub issue #332 is to follow up on that.
- ALP objects now include ALP types such as `grb::Phase`. This was required to unambiguously dispatch between `grb::set(matrix,matrix)` and `grb::set(matrix,mask,scalar)` via SFINAE.

Additionally, this MR includes the following bugfixes:

1. copy-contructor of pattern matrix iterators for more than one user processes did not copy PID information correctly;
2. the `fold_matrix_to_scalar` unit test relied on undefined behaviour, here fixed;
3. matrix reduction into a scalar could fail if the matrix is small w.r.t. the number of user processes;
4. selection operators erroneously did not appear in user documentation;
5. the specification for resize and execute phases was outdated: if in execution phase it is detected that the output container has insufficient capacity, then primitives should return `ILLEGAL`;
6. the BSP1D set-vector-to-value erroneously returned `FAILED` instead, herewith fixed.

The impact of bugs 2-4 is expected very low as it was only present in the `develop` branch and only for a limited time. Issues 1 and 5 were present longer, however, prior to crafting this MR and as far as we know, seem never to have been triggered or noticed. Issue 5 furthermore did not induce any code changes, except for the bug in issue no. 6. That bug (no. 6), however, never triggers in the currently available back-ends because vectors have fixed full capacities (the bug would only apply for final backends that do not have such a fixed full capacity).

Last, and as always, the MR minor includes code style and documentation fixes in files related and unrelated to this MR.

Many thanks to Benjamin Lozes @byjtew for drafting the initial version of the MR!

338 request for fuselets (#339)

This MR provides so-called _fuselets_.

Fuselets are sequences of operations that may occur in existing code bases, and could be accelerated using the nonblocking backend. A fuselet represents such a sequence of operations, which are exposed as a single plain-C function call. ALP during its standard build will generate a library of those fuselets using its nonblocking backend, thus resulting in high-performance, automatically fused kernels.

The fuselets furthermore, at run-time and again automatically, tunes performance parameters such as tile sizes and the number of threads to be used.

Finally, the example fuselets provided in `include/transition/fuselets.h` and `src/transition/fuselets.cpp` demonstrate how easy it is to use ALP to provide arbitrary fuselets that existing code bases may require, and are easily modified or extended.

This MR also includes:
 - smoke and performance tests for the new fuselets;
 - standard semiring and monoid definitions in the new `grb::monoids` and `grb::semirings` namespaces;
 - tests for those standard semirings and monoids (insofar possible);
 - a bugfix in the stdout of the spmspm unit test;
 - a bugfix for missing cstdint includes in various headers; and
 - as always, minor code style fixes.

340 nonblocking grbset ignores use index descriptor (#341)

This MR addresses the following bugs:
 - the combination of `use_index` and `dense` descriptors did not work for vector-to-vector `grb::set` in the nonblocking backend;
 - a concurrency issue existed for most variants of the nonblocking vector-output `grb::set` when the `dense` descriptor was passed;
 - for many variants of the BSP1D vector-output `grb::set` with `use_index` given, the result would incorrectly use local indices rather than global ones.

A unit test has been added that tests all variants of vector-output `grb::set` with the `use_index` descriptor given, including also variants that add `invert_mask` or `dense` descriptors (on top of `use_index`). This has become a separate unit test, setToIndex. It is this new test that detected the latter two bugs; the former was found while resolving GitHub issue #335 .

Additionally, this MR:
 - addresses a meta-bug where the nonblocking backend was only ever unit-tested with the full number of threads, instead of three runs using progressively more threads as was originally intended;
 - fixes typos and fixes minor code style issues.

335 wrong fma perf test (#336)

The fma (fused multiply-add) performance test aims to replicate a simple triad benchmark, computing `z=alpha.*x+y` out-of-place.

The matching ALP/GraphBLAS primitive for that, once upon a time, was `grb::eWiseMulAdd`. Since that time, however, that primitive has undergone two changes: 1) it became in-place rather than out-of-place (i.e., computing `z+=alpha.*x+y`) while 2) since the release of the nonblocking backend this function has become deprecated (as the same could be computed using `grb::eWiseMul` followed by `grb::foldl` or `grb::foldr`, at negligible performance overheads compared to the one-shot `grb::eWiseMulAdd`).

Neither change was ever reflected in the `fma` test itself, however; and, at present, the original out-of-place `fma` computation `z=alpha.*x+y` similarly has no single matching (deprecated or not) ALP/GraphBLAS primitive. The nonblocking backend, however, could implement an fma by first calling `grb::set(z,y)` followed by the in-place `grb::eWiseMul`. 

Additionally, since the incorporation of the CMake build infra, the compiler-optimised performance tests were erroneously not compiled with performance flags, causing a further apple-to-oranges type comparison in this performance test.

The issues were detected by Alberto Scolari, who additionally indicated that adding performance tests to the CI and regularly reviewing those results would have caught this issue earlier (crossref #343 , visualisation only - the performance test now actually regularly trigger for `develop` on our internal CI). He also produced an initial set of fixes and we thank Alberto for both.

This MR fixes these issues regarding the fma performance test by:
 1. introducing the fma-blocking and fma-nonblocking shared-memory parallel performance test instead of a single fma-omp one. Only for fma-nonblocking is performance expected to match that with a compiler-optimised or lambda-generated fma;
 2. this distinction is now also printed to screen as part of the test run; and
 3. improved test initialisation checks and improved error detection.

This MR also introduced some changes to the `dot` and `reduce` performance tests, in tandem with changes to the `fma` performance test. Those "joint" changes are:
 4. the compiler-optimised shared-memory parallel fma (as well as the reduce and dot) performance tests now avoid critical sections (which is in line with standard HPC practices), and e.g. for reductions (reduce and dot) prefer the OpenMP `reduction`-clause;
 5. the compiler-optimised shared-memory parallel fma, reduce, and dot now use the same distribution of work across threads (essentially a static block-wise schedule);
 6. both sequential and shared-memory parallel compiler-optimised benchmarks are now given the proper performance flags during compilation;
 7. avoid mixing `fprintf` and `stdcerr/stdcout` in the fma, dot, and reduce performance tests as well as other more minor code style fixes;
 8. test output and test summary now distinguish between sequential and shared-memory parallel tests;
 9. use the `dense` descriptor where appropriate (potentially enhancing performance of ALP code);
 10. if any test auto-tunes the number of inner repetitions, the number is chosen so that a single experiment is expected to take no less than 100 milliseconds (down from 1 second);
 11. these tests now employ vectors of 100 million elements (up from 10 million); and, finally,
 12. it is double-checked that the numbers the new tests produce are on par with - or exceeding the performance of - the numbers published by Yzelman et al. (2020).

654 grb::set matrix to matrix broken in mixed domain (#290)

This MR fixes the behaviour of `grb::set( matrix, * )` by 1) correctly interpreting output masks and 2) fixes the behaviour of casting values from the input matrix value type to that of the output matrix.

This MR also
- adds a unit test for both fixes to guard against regressions;
- fixes / updates the base specification of `grb::set( matrix, * )`;
- allows for `grb::set( matrix, matrix[, scalar] )` to work for two matrices with different index / offset types;
- improves debug tracing for the reference `Compressed_Storage` class;
- includes minor code style fixes.

Thanks to Benjamin Lozes for initially identifying the issue and providing the fix!

